import React from "react";
import axios from "axios";

function Articles() {

  axios.get('http://localhost:3000/articles')
  .then(response => {
    console.log(response.data);
  })
  .catch(error => {
    console.error('Error fetching data:', error);
  });

  return (
    <div>
      <h1>Articles List</h1>


    </div>
  );
}

export default Articles
